import  React from 'react';
import { 
    HomeContainer, 
    TitleContainer, 
    InfoContainer, 
    LogoContainer,
    Menu,
    Itens
} from './styles';


import Logo from '../../assets/K.png';
// import Card from '../Card';

import GitHubIcon from '@material-ui/icons/GitHub';


const Home = ()=> {

    return(
        <HomeContainer>
            <TitleContainer>
                <LogoContainer>
                    <img src={Logo} alt="Logo" />
                    <h1>KLIHSMAN</h1>
                </LogoContainer>
                <Menu>
                    <Itens>
                        <GitHubIcon />
                        <h4>GitHub</h4>
                    </Itens>
                    <Itens><h4>Instagram</h4></Itens>
                    <Itens><h4>Whatsapp</h4></Itens>
                    <Itens><h4>LinkedIn</h4></Itens>
                </Menu>
            </TitleContainer>
            <InfoContainer>
            </InfoContainer>
        </HomeContainer>
    )
}

export default Home;
